import './App.css';
import { Marquee } from './Marquee';
import { Profile } from './Profile';
import { Projects } from './Projects';
import { Footer } from './Footer';

function App() {
  return (
    <div className="App">
      <Marquee/>
      <Profile/>
      <Projects/>
      <Footer/>
    </div>
  );
}

export default App;
